textOriginal:
Papa Pio XII, ao 1 de julho de 1949, 
publicou Decreto que afirma a EXCOMUNHÃO AUTOMÁTICA (latae sententiae) aos católicos que se associarem à ideologia de "esquerda"  (marxista, comunista, socialista ou similar). 
   Papa João XXIII publicou, aos 4 de abril de 1959, o Dubium, documento do Santo Ofício, reafirmando que não é permitido aos católicos votarem em candidatos de partidos de esquerda 
(marxistas, comunistas, socialistas ou similar) ou quaisquer relacionados a essa ideologia. 

Papas que excomungaram o socialismo, a ideologia de Lula, e aos católicos que votam em candidatos socialistas ou de esquerda:  
- Papa Pio IX, em 8 de dezembro de 1849; 
- Papa Leão XIII, em 29 de junho de 1881; 
- Papa Pio X, em 25 de agosto de 1910; 
- Papa Bento XV, em 1 de novembro de 1914; 
- Papa Pio XI, em 15 de maio de 1931; 
- Papa Pio XII, em 1 de julho de 1949; 
- Papa João XXIII, em 4 de abril de 1959; 
- Papa João Paulo II enfrentou o comunismo de frente, na Polônia, 
Alemanha, Nicarágua... confirmou excomunhão ao socialista Fidel Castro, e sofreu atentado à mando de socialistas soviéticos, em 1981; 
- Papa Bento XVI, em 6 de agosto de 1984, reafirmou a excomunhão da ideologia socialista.

Não farás para ti imagem de escultura, nem semelhança alguma do que há em cima no céu, nem em baixo na terra, nem nas águas debaixo da terra;
Não te encurvarás a elas, nem as servirás
Deuteronômio 5:8,9
